import{_ as e,o,c as i,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 32.1-66 Commissioner to notify physicians; reports to Commissioner.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/32.1-66.md","filePath":"vacode/32.1-66.md"}'),t={name:"vacode/32.1-66.md"},s=r('<h1 id="§-32-1-66-commissioner-to-notify-physicians-reports-to-commissioner" tabindex="-1">§ 32.1-66 Commissioner to notify physicians; reports to Commissioner. <a class="header-anchor" href="#§-32-1-66-commissioner-to-notify-physicians-reports-to-commissioner" aria-label="Permalink to &quot;§ 32.1-66 Commissioner to notify physicians; reports to Commissioner.&quot;">​</a></h1><p>Whenever a newborn screening test result indicates suspicion of any condition pursuant to § <a href="http://law.lis.virginia.gov/vacode/32.1-65/" target="_blank" rel="noreferrer">32.1-65</a>, the Commissioner shall notify forthwith the attending physician and shall perform or provide for additional testing required to confirm or disprove the diagnosis. All physicians, certified nurse midwives, public health nurses, or any nurse receiving such test result, and administrators of hospitals in the Commonwealth, shall report the discovery of all cases of any condition for which newborn screening is conducted pursuant to § <a href="http://law.lis.virginia.gov/vacode/32.1-65/" target="_blank" rel="noreferrer">32.1-65</a> to the Commissioner for infants and children up to two years of age.</p><p>Code 1950, § 32-112.5; 1966, c. 179; 1979, c. 711; 1986, c. 172; 1988, c. 97; 2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0717" target="_blank" rel="noreferrer">717</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0721" target="_blank" rel="noreferrer">721</a>.</p>',3),n=[s];function a(c,l,h,p,d,m){return o(),i("div",null,n)}const g=e(t,[["render",a]]);export{_ as __pageData,g as default};
